import { Link } from 'react-router-dom'

const Footer = () => {
  return(
    <div className="footer">
      <div className="foot-a"><h4 className='connect'>Connect with me!</h4></div>
      <div className="foot-b"><a href="https://github.com/cbenks" target="_blank" rel="noopener noreferrer">GitHub</a></div>
      <div className="foot-c"><a href="https://www.linkedin.com/in/corybenicak/" target="_blank" rel="noopener noreferrer">LinkedIn</a></div>
      <div className="foot-d">Contact</div>
    </div>
  )
}
export default Footer
